'use strict';
let PdasMessage = require('./PdasMessage.js');
let PdasMessageItemWithChild = require('./PdasMessageItemWithChild.js');
class PdasMessageBuilder extends PdasMessage {
    build(msgType) {
        this.msgType = msgType;
        this.children = new PdasMessageItemWithChild();
        return this;
    }
}
module.exports = PdasMessageBuilder
